social_posts.post_text:
Finally got the rally car out to a proper event this past weekend: the @rallyready Do it for Dale Rallysprint in Texas. WOW this thing is a blast on gravel!

The car blew up at Gridlife last September, and @nightmotorsport came through with an all-new engine build just in time for the sprint.

Big shout out to @micah_diaz_ for the long haul out to Austin with this thing, @texas_dave and the Rally Ready crew for an amazing event, and @jtarticle15 for supporting US rally in a big way. 

Footage from:
@mattbrassfieldrally 
@wilsonized 
@buckylasek 
@ticklefarts

My original Evo RS is back on the road for the first time since 2017… and now with waaaay more spice thanks to @speedlab_inc. Damn it’s good to be back in it!

We hit way beyond the 650whp I was looking for, but @ronibuilt doesn’t mess around 😂

Drivetrain setup:
SpeedLab SPL 2.2l built block and machined head
@haltechecu Elite 2500 ecu
@garrettmotion g30-900 twin scroll
@fullracemotorsports manifold
@gscpower s2 cams, springs, and headwork
@cp_carrillo rods
@callies_performance billet crank
@skunk2racing intake manifold
@radiumengineering double pumper fuel setup
Full body revival by @horns_collisioncenter 
@seiboncarbon doors/hood/fenders

